// this line should not be removed
var wProgressBar = angular.module( "wProgressBarGC",[]);

wProgressBar.controller( "wProgressBarGCController", function( $scope ) {
   /*Controller has no Data*/
});

//Defining the Progress Bar Directive
wProgressBar.directive("progressBar", ["$timeout", function ($timeout) {
    return {
        restrict: "EA",
        template:
            "<span class='small'>{{label}}</span>" +
            "<div class='progress {{stripeClass}} {{animClass}}'>"+
      "   <div class='progress-bar {{barClass}}' style='width:{{complete/total * 100}}%;'>{{showPercent ? (complete/total*100) : complete | number:0}} {{completeLabel}}</div>" +
            "</div>",
        scope: {
            total: '@total',
            complete: '=complete',
          	barClass: '@barClass',
          	stripeClass: '@stripeClass',
          	animClass: '@animClass',
          	completeLabel: '=completeLabel',
          	label: '@label'

        },
        link: function (scope, elem, attrs) {

            scope.showPercent = (attrs.showPercent) || false;


        }

    };
}]);
